CREATE TABLE employees (
  id SERIAL PRIMARY KEY,
  name TEXT,
  role TEXT
);


create table MOCK_DATA (
	id INT,
	first_name VARCHAR(50),
	last_name VARCHAR(50),
	email VARCHAR(50),
	gender VARCHAR(50),
	country VARCHAR(50),
	st_address VARCHAR(50),
	ipv4_address VARCHAR(20),
	ipv6_address VARCHAR(50),
	mac VARCHAR(50)
);
